import React from "react";
import {Grid, Text} from "../elements";
// import { List } from "../elements";

const SideBar = (props) => {



    return (
        <React.Fragment>
            <Grid padding="20px" bg="#EFF6FF">
                <Text>
                    <h2><b>카테고리</b></h2>
                </Text>
                <li>
                    전체
                </li>
                <li>
                    여행
                </li>
                <li>
                    맛집
                </li>
                <li>
                    독서
                </li>
            </Grid>

            {/* <List/> */}
        </React.Fragment>
    )
}

export default SideBar;
